import Row from './Row.js'

export default function NavBar() {
  return (
    <Row>
      <ul>
        <li><a>About</a></li>
        <li><a>Skills</a></li>
        <li><a>Experience</a></li>
        <li><a>Education</a></li>
        <li><a>Contact</a></li>
      </ul>
      <style jsx>{`
        ul {
          margin: 0;
          padding: 0;
          list-style: none;
        }
      `}</style>
    </Row>
  )
}
